import React from 'react';

const AuctioneerDashboard = () => {
  return (
    <div className="container mx-auto p-6">
      <h1 className="text-3xl font-semibold">Auctioneer Dashboard</h1>
      <div className="mt-6">
        <h2 className="text-2xl font-medium">Manage Auctions</h2>
        <div className="mt-4">
          <button className="bg-blue-600 text-white p-2 rounded">
            Create New Auction
          </button>
        </div>
        <div className="mt-6">
          <h3 className="text-xl font-medium">Active Auctions</h3>
          {/* Render active auctions here */}
          <ul>
            <li>Auction 1</li>
            <li>Auction 2</li>
          </ul>
        </div>
      </div>
    </div>
  );
};

export default AuctioneerDashboard;
